import React from 'react';
import { Tag, Tooltip, Button, Modal, Form, Input, Select, DatePicker } from 'antd';
import { SolutionOutlined,ManOutlined,WomanOutlined } from '@ant-design/icons';
import { useState } from 'react';
const Item=(props)=>{
    const [visible, setVisible] = useState(false);
    const [addVisible, setAddVisible] = useState(false);
    return (
        <tr key={props.e.id}>
            <td>{props.e.departmentId}</td>
            <td>{props.e.departmentName}</td>
            <td>{props.e.startDate}</td>
            <td>
                <Tooltip title="Update here!">
                    <Button
                        shape="circle"
                        icon={<SolutionOutlined />}
                        onClick={toggleAddVisible} />
                    <Modal
                        visible={addVisible}
                        title="Employee Information"
                        onCancel={handleAddCancel}
                    >
                        <Form {...layout}>  
                            <Form.Item
                                label="Employee Name"
                                name="employeeName"
                                hasFeedback>
                                <Input readOnly size="small" />
                            </Form.Item>
                            <Form.Item
                                label="Position"
                                name="position"
                                hasFeedback>
                                <Input readOnly size="small" />
                            </Form.Item>
                            <Form.Item
                                label="Deparment"
                                name="department"
                                hasFeedback>
                                <Input readOnly size="small" />
                            </Form.Item>
                            
                        </Form>
                    </Modal>
                </Tooltip>
            </td>
        </tr>
    );
}

export default Item;
